import React, { useEffect, useState } from "react";
import {
  Platform,
  ScrollView,
  StyleSheet,
  KeyboardAvoidingView,
  View,
  Text,
} from "react-native";
import { SvgXml } from "react-native-svg";
import { checkOTP, sendOTP } from "../../Class/auth";
import ActivityLoader from "../../components/ActivityLoader";
import IconButton from "../../components/IconButton";
import Input from "../../components/Input";

export default function SignUp_2({ navigation, route }) {
  const number = route?.params?.number;
  const [otp, setOtp] = useState();
  const name = route?.params?.name;
  const [error, setError] = useState(false);
  const [counter, setCounter] = useState(90);
  const [loader, setLoader] = useState(false);
  const [token, setToken] = useState();

  useEffect(() => {
    const timer =
      counter > 0 && setInterval(() => setCounter(counter - 1), 1000);
    return () => clearInterval(timer);
  }, [counter]);
  const resendOTP = async () => {
    setError();
    setLoader(true);
    setCounter(90);
    setOtp()
    try {
      await sendOTP(number);
      setLoader(false);
    } catch (err) {
      setLoader(false);
      console.error(err.message);
    }
  };
  const check = () => {
    setError();
    setLoader(true);
    checkOTP(number, otp)
      .then((res) => {
        setLoader(false);
        navigation.navigate("SignUp_3",{token:res.data?.token})
        //console.log(res.data);
      })
      .catch((err) => {
        setLoader(false);
        setError(err.response.data.msg);
      });
  };
  if (loader) {
    return (
      <View style={{ flex: 1, justifyContent: "center", alignItems: "center" }}>
        <ActivityLoader />
      </View>
    );
  }

  return (
    <KeyboardAvoidingView
      style={{ flex: 1 }}
      behavior={Platform.OS === "ios" ? "padding" : null}
      keyboardVerticalOffset={Platform.OS === "ios" ? 80 : 0}>
      <ScrollView showsVerticalScrollIndicator={false}>
        <View
          style={{
            paddingHorizontal: 20,
          }}>
          <SvgXml width={"100%"} style={signUpStyle.mt28} xml={vector} />
          <Text style={[signUpStyle.headLine, signUpStyle.mt44]}>
            Verify your Number
          </Text>
          <Text style={[signUpStyle.mt8, signUpStyle.text]}>
            We have sent a code to your {number}. Please enter the code to
            proceed.
          </Text>
          <Input
            keyboardType={"number-pad"}
            value={otp}
            onChange={setOtp}
            style={[signUpStyle.input, signUpStyle.mt18]}
            placeholder={" "}
          />
          {counter > 0&&!error ? (
            <Text style={[signUpStyle.text]}>
              Wait {counter}s before requesting another code
            </Text>
          ) :!error? (
            <Text style={[signUpStyle.text]}>
              Did not get it yet?{" "}
              <Text
                onPress={resendOTP}
                style={{
                  color: "red",
                  textDecorationLine: "underline",
                }}>
                Send again
              </Text>
              .
            </Text>
          ):error?(
            <Text style={[signUpStyle.text,{color:"red"}]}>
            The code you entered does not match. {" "}
              <Text
                onPress={resendOTP}
                style={{
                  color: "black",
                  textDecorationLine: "underline",
                }}>
                Send again
              </Text>
              .
            </Text>
          ):null}
        </View>
      </ScrollView>
      <IconButton
        disabled={otp && counter > 0 ? false : true}
        active={otp && counter > 0 ? true : false}
        onPress={() => {
          check()
          
        }}
        style={signUpStyle.button}
        title={"Continue"}
      />
    </KeyboardAvoidingView>
  );
}
